function App() {

  const welcome = {
    greeting: "Hello",
    title: "React",
  };

  function getTitle(title) {
    return title ? title : "World";
  }

  return (
    <div className="App">
      <h3>Hello, (title)</h3>

      <label htmlFor="search">Search: </label>
      <input id="search" type="text" placeholder="Search..." />
    </div>
  );
}

export default App;
